// },[])

  return (
    <>
        <Typography variant="h5">My Custom Accordian Style</Typography>
      
        {
            question.map((item)=>{
               return <MyAccordian key={item.id} {...item}/>
            })
        }
    </>
  );
}

export default Accordian;
